		/*
		 Person storage person2 = Person({name:'jack', sex:'famale', age:18});
		 Person storage person3 = Person;
	    */

		Person memory person = t16_1({_name:'joy', _sex:'male', _age:10});
		t16_2(person); //memory->memory : person.age == 100
